import styles from "./App.module.css";
import NavBar from "./components/Nav/NavBar";
import FullWidthSection from "./components/FullWidthSection";
import CentralSection from "./components/CentralSection";
import NavButton from "./components/Nav/NavButton";

function App() {
  return (
    <div className={styles.App}>
      <NavBar />
      <div className={styles.navbarSpacer}></div>
      <FullWidthSection>
        <div className={styles.panelsSpan}></div>
      </FullWidthSection>
      <CentralSection>
        <div className={styles.centralHeader}>
          We provide quality residential Solar PV and energy storage solutions
          for both grid-tied and off-grid applications.
        </div>
        <div className={styles.centralHeader}>
          <b>Helio Photovoltaic</b> is based primarily in the lower mainland,
          but can also service Vancouver Island, the Okanagan, and the
          Cariboo/Chilcotin.
        </div>
      </CentralSection>
      <CentralSection>
        <div>Request Free Solar Quote!</div>
      </CentralSection>
    </div>
  );
}

export default App;
